	@Inject
	public MyDslGrammarAccess(GrammarProvider grammarProvider,
			TerminalsGrammarAccess gaTerminals) {
		this.grammar = internalFindGrammar(grammarProvider);
		this.gaTerminals = gaTerminals;
		this.pICalFormat = new ICalFormatElements();
		this.pComponent = new ComponentElements();
		this.pAlarmType = new AlarmTypeElements();
		this.pCalendar = new CalendarElements();
		this.tSTR = (TerminalRule) GrammarUtil.findRuleForName(getGrammar(), "xCalendar.MyDsl.STR");
		this.tINT = (TerminalRule) GrammarUtil.findRuleForName(getGrammar(), "xCalendar.MyDsl.INT");
		this.pMonth = new MonthElements();
		this.pMonthNameT = new MonthNameTElements();
		this.pMonthT = new MonthTElements();
		this.pDateT = new DateTElements();
		this.pClassification = new ClassificationElements();
		this.pStatus = new StatusElements();
		this.pEventStatus = new EventStatusElements();
		this.pDayName = new DayNameElements();
		this.pEventC = new EventCElements();
		this.pAlarmC = new AlarmCElements();
		this.pTzprop = new TzpropElements();
		this.pTzpropOptional = new TzpropOptionalElements();
		this.pComponentAlarmTime = new ComponentAlarmTimeElements();
		this.pComponentAlarmAudioProperty = new ComponentAlarmAudioPropertyElements();
		this.pComponentAlarmDispProperty = new ComponentAlarmDispPropertyElements();
		this.pComponentAlarmEmailProperty = new ComponentAlarmEmailPropertyElements();
		this.pToDoC = new ToDoCElements();
		this.pJournalC = new JournalCElements();
		this.pVacationC = new VacationCElements();
		this.pTimeZoneC = new TimeZoneCElements();
	}
	
	protected Grammar internalFindGrammar(GrammarProvider grammarProvider) {
		Grammar grammar = grammarProvider.getGrammar(this);
		while (grammar != null) {
			if ("xCalendar.MyDsl".equals(grammar.getName())) {
				return grammar;
			}
			List<Grammar> grammars = grammar.getUsedGrammars();
			if (!grammars.isEmpty()) {
				grammar = grammars.iterator().next();
			} else {
				return null;
			}
		}
		return grammar;
	}
	
	@Override
	public Grammar getGrammar() {
		return grammar;
	}
	
	
	public TerminalsGrammarAccess getTerminalsGrammarAccess() {
		return gaTerminals;
	}

	
